        <div className='absolute h-[750px] w-[600px] border right-0 bottom-0 bg-white rounded-tl-xl shadow flex justify-center'>
            <div className='flex flex-col'>
                <p className='font-bold text-[20px]'>{getDate(today)} 현황</p>
                <div>
                    asf
                </div>
            </div>
        </div>
    )
}
